import './MyForm.css';

const MyForm = () => {
  return (
    <div>
        {/* 1 criacao de form */}
        <form>
            <div>
                <label htmlFor="name">Nome:</label>
                <input type="text" name="name" placeholder="Digite o seu name" value="" />
            </div>
            <input type="submit" value="Enviar" />
            {/* 2 label envolvendo input */}
            <label>
                <span>E-mail</span>
                <input type="email" name="email"/>
            </label>
        </form>
    </div>
  )
}

export default MyForm
